const MainServices = () => {
	return (
		<div className='container'>
			<div className='row justify-content-center mt-5'>
				<div>
					<h2 className='section-title'> Beruflich Leistungen</h2>
				</div>
			</div>
			<div className='row'>
				<div className='col'>Main Services Section</div>
			</div>
		</div>
	);
};

export default MainServices;
